import React from "react";
import { Grid, Button, TextField } from "@mui/material";

export const Home = () => {
  return (
    <Grid container spacing={2}>
      <Grid item xs={6}>
        <TextField variant="outlined" fullWidth label="ENTER Nmae" />
      </Grid>
      <Grid item xs={6}>
        <Button variant="contained" fullWidth color="success">
          Submit
        </Button>
      </Grid>
    </Grid>
  );
};
